All identifiers used in the license configuration section are expected to be valid SPDX v2.1 short identifiers, either from version 3.11 of the SPDX License List , or use a custom identifier by prefixing it with LicenseRef-. allow = [ # The Apache license identifier "Apache-2.0", # A custom license identifier "LicenseRef-Embark-Custom",
] # Custom license refs can be specified for crates which don't use a license
# in the SPDX list
[[licenses.clarify]]
name = "a-crate"
expression = "LicenseRef-Embark-Custom"
license-files = [ { path = "LICENSE", hash = 0x001c7e6c },
] License identifiers can also be coupled with an optional exception by appending WITH <exception-id> to the license identifier. Licenses coupled with exceptions are considered distinct from the same license without the exception. allow = [ # The Apache license identifier "Apache-2.0", # The Apache license + LLVM-exception "Apache-2.0 WITH LLVM-exception",
]

117.body:
The license configuration generally applies to the entire crate graph, but this means that allowing any one license applies to all possible crates, even if only 1 crate actually uses that license. The exceptions field is meant to allow licenses only for particular crates, to make a clear distinction between licenses which you are fine with everywhere, versus ones which you want to be more selective about, and not have implicitly allowed in the future. The exceptions.name field The name of the crate that you are adding an exception for The exceptions.version field (optional) An optional version constraint specifying the range of crate versions you are excepting. Defaults to all versions (*). The allow field This is the exact same as the general allow field. [licenses]
allow = [ "Apache-2.0", "MIT",
]
exceptions = [ # This is the only crate that cannot be licensed with either Apache-2.0 # or MIT, so we just add an exception for it, meaning we'll get a warning # if we add another crate that also requires this license { name = "cloudabi", allow = ["BSD-2-Clause"] },
]

